//import ReactDOM from 'react-dom';
import { Link, Switch } from 'react-router-dom';
import { BrowserRouter as Router, Route} from "react-router-dom";
import '../home.css';
import axios from 'axios';

class business extends React.Component {
	constructor(props) {
        super(props);

        this.state = {
            bName: '',
            pAbrv: ''
		}

    //this.bName = this.bName.bind(this)
    //this.pAbrv = this.pAbrv.bind(this)
    this.handleSubmit = this.handleSubmit.bind(this)
     this.handleChange = this.handleChange.bind(this)


	}

    handleChange() {
        this.setState({
           bName: this.businessName,
           pAbrv: this.phoneAbrv,
        })
    }

	render () {
     
        return (            
            
            <div className = "section">

		     <label type="button" className="add" >Add Business</label>
         

                         <form id="form" action="/addBusiness" method="post" noValidate>

                               <input id="name" value={this.businessName} />
                               <input id="Abrv" value={this.phoneAbrv}/>

                              <button type="submit">Login</button>
                        
                  

                            </form> 
            </div>
        );
    }
}

export default business;
